  Drupal.behaviors.parallax = {
    attach: function (context, settings) {

        if ($('.article-type-longform .field-name-field-media .field-item img').length > 0) {
             //console.log($('.field-name-field-media img').first().attr('data-src'));
             var mainImg = $('.field-name-field-media img').first();
             var parallaxBlock = $('.article-type-longform .field-name-field-media');
             mainImg.hide();
             //var parallaxBlockOffTop = parallaxBlock.offset().top;
             //parallaxBlock.css('background-position-y', parallaxBlockOffTop + 'px');
             parallaxBlock.css('background-image', 'url("' + mainImg.attr('src') + '")');
             parallaxBlock.css({"opacity":0}).delay(200).css({"opacity":1});

            /*$(window).scroll(function() {
                var y_offset = $(this).scrollTop();
                parallaxBlock.css('background-position-y', (parallaxBlockOffTop - (y_offset * 1.5)) + 'px');

            });*/

            var hghtadj = 0;
            if ( $(".node-subheadline").length > 0 ) {
              hghtadj = $(".node-subheadline").offset().top - $(window).height();
            } else {
              hghtadj = $(".group-story-timestamp").offset().top - $(window).height();
            }
            var currhght = parallaxBlock.height();
            parallaxBlock.css('height', Number(currhght - hghtadj));
        }

        if ( $(".article-type-longform .field-name-body .longform-chaplinks").length == 1 ) {
          $(".field-name-body .longform-chaplinks").appendTo("nav[role=navigation]");

          $(".article-type-longform .longform-chaplinks .visbutton").on("click", function() {
            $(this).parent().toggleClass('active');
          });
        }
    }
  };

