  Drupal.behaviors.uadetect = {
    attach: function (context, settings) {
      var domElemList = [".group-liveblog-heading",".pulsedotsvg",".pulsedot",".pulsedot > span"];
      $(document).ready(function() {
        if (navigator.userAgent) {
          var clientplatform = (navigator.userAgent).toLowerCase();
          var isMac = clientplatform.indexOf("macintosh") > -1? true: false;
          var isAndroid = clientplatform.indexOf("android") > -1? true: false;
          var isIE = clientplatform.indexOf("trident") > -1? true: false;
          var isFF = clientplatform.indexOf("firefox") > -1? true: false;
          var isSafari = false;
          if ((clientplatform.indexOf("safari") > -1) && (clientplatform.indexOf("chrome") == -1)) {
            isSafari = true;
          }

          if (isMac) {
            domElemList.forEach(function(elem) {
              $(elem).addClass("mac");
            });
            document.querySelector('body').classList.add('ua-mac');
          }
          if (isAndroid) {
            domElemList.forEach(function(elem) {
              $(elem).addClass("android");
            });
            document.querySelector('body').classList.add('ua-android');
          }
          if (isIE) {
            domElemList.forEach(function(elem) {
              $(elem).addClass("ie");
            });
            document.querySelector('body').classList.add('ua-ie');
          }
          if (isSafari) {
            document.querySelector('body').classList.add('ua-safari');
          }
          if (isFF) {
            document.querySelector('body').classList.add('ua-ff');
          }
        }
      });
    }
  };

  // REPLACE THE ORIGINAL BOREALIS FUNCTION
  Drupal.behaviors.borealis_ri = {
    attach: function (context, settings) {
      //console.log(settings);
      if (typeof settings.borealis_ri == "undefined") {
        return;
      }

      $(document).ready(function() {

        var windowWidth_curr = document.body.clientWidth;

        settings = Drupal.settings.borealis_ri.sizes;
        settingsArray = sortObject(settings);
        settingArrayLength = settingsArray.length;
        lazyload = Drupal.settings.borealis_ri.lazyload;
        aspectRatio = Drupal.settings.borealis_ri.aspect_ratio;
        styleArray = Drupal.settings.borealis_ri.styleArray;

        var sizeArraySort = new Array();
        var styleArraySort = new Array();
        for (i = 0; i < settingArrayLength; i++) {
          sizeArraySort.push(settingsArray[i].value);
          styleArraySort.push(settingsArray[i].key);
        }

        sizeArray = sizeArraySort;
        styleArray = styleArraySort;

        arraySize = sizeArray.length;

        if (lazyload) {
          borealisImagePlaceholder();
        } else {
          borealisImageRespond();
        }

        // When the screen is resized, check again! (Smarter)
        window.onresize = debounce(function(){
          var windowWidth_temp = document.body.clientWidth;
          if (windowWidth_temp > windowWidth_curr) {
            if (lazyload) {
              borealisImagePlaceholder();
            } else {
              borealisImageRespond();
            }
            windowWidth_curr = windowWidth_temp;
          }
        }, 20);

        // When the screen is scrolled, do it again! (Smarter)
        window.onscroll = debounce(function(){
          if (lazyload) {
            borealisImagePlaceholder('scroll');
          } else {
            borealisImageRespond();
          }
        }, 20);

        function borealisImageRespond() {
          var images = document.querySelectorAll('img.borealis');
          var imageLength = images.length;

          for (var i = 0; i < imageLength; i++) {
            var image = images[i];
            borealisFindImage(image);
          } // End Image Loop
        }

        function borealisImagePlaceholder(isScroll) {
          //console.log('borealisImagePlaceholder augment:', isScroll);

          var images;
          if (isScroll) {
            // minimise the subsequent for loop by getting only blank images
            images = document.querySelectorAll('img.borealis[src="/sites/all/modules/contrib/borealis/borealis_ri/images/blank.png"]');
          } else {
            images = document.querySelectorAll('img.borealis');
          }

          var imageLength = images.length;

          for (var i = 0; i < imageLength; i++) {
            var image = images[i];
            var width = blockParentWidth(image);
            var height = width * aspectRatio;

            var imgStyle = image.getAttribute('data-borealis-style') ? true : false;

            if (!imgStyle) {
              image.setAttribute('width', width);
              image.setAttribute('height', height);
            }

            if (elementInViewport(image)) {
              borealisFindImage(image);
            }
          }
        }

        function elementInViewport(el) {
          var rect = el.getBoundingClientRect();

          return (
            rect.left >= 0
            && rect.top <= (window.innerHeight || document.documentElement.clientHeight)
          );
        }

        function blockParentWidth(element) {
          var parentNode = element.parentNode;
          var parentDisplay = getComputedStyle(parentNode).display;

          if (parentDisplay.indexOf('inline') >= 0 && parentDisplay.indexOf('block') < 0) {
            return blockParentWidth(parentNode);
          }
          else {
            return parseInt(getComputedStyle(parentNode).width);
          }
        }

        function sortObject(obj) {
          var arr = new Array();
          for (var attr in obj) {
            if (obj.hasOwnProperty(attr)) {
              arr.push({
                'key': attr,
                'value': obj[attr]
              });
            }
          }
          arr.sort(function(a, b) {
            return a['value'] - b['value'];
          });
          return arr; // returns array
        }
        function debounce(func, wait, immediate) {
          var timeout;
          return function() {
            var context = this, args = arguments;
            var later = function() {
              timeout = null;
              if (!immediate) {
                func.apply(context, args);
              }
            };
            var callNow = immediate && !timeout;
            clearTimeout(timeout);
            timeout = setTimeout(later, wait);
            if (callNow) {
              func.apply(context, args);
            }
          };
        }
        function hasClass(el, name) {
          return new RegExp('(\\s|^)'+name+'(\\s|$)').test(el.className);
        }
        function removeClass(ele,cls) {
          if (hasClass(ele,cls)) {
            var reg = new RegExp('(\\s|^)'+cls+'(\\s|$)');
            ele.className=ele.className.replace(reg,' ');
          }
        }
        function addClass(el, name) {
          if (!hasClass(el, name)) {
            el.className += (el.className ? ' ' : '') +name;
          }
        }


        function borealisFindImage(image) {
          var width = blockParentWidth(image);

          if (width > 0) {
            var slfor = arraySize - 1;
            swapped = false;

            if (width <= sizeArray[0]) {
              borealisImageSwap(image, -1, width);
            } else if (width >= sizeArray[slfor + 1]) {
              borealisImageSwap(image, slfor, width, true);
            } else {
              for (j = slfor; j >= 0; j--) {
                if (width >= sizeArray[j]) {
                  borealisImageSwap(image, j, width);
                  j = -1;
                }
              }
            } // End Size Loop
          } //End Width > 0 Check
        }

        function borealisImageSwap(img, index, width, bypass) {
          // Increase index by one to get the next highest size
          index++;

          if (img.getAttribute('data-locked')) {
            return;
          }

          img.setAttribute('data-locked', 1);

          // Set Bypass
          bypass = (typeof bypass === "undefined") ? false : bypass;

          // Get current image style
          var imgStyle = img.getAttribute('data-borealis-style') ? img.getAttribute('data-borealis-style') : styleArray[0];

          // Get Device Pixel Ratio
          var dpr = (window.devicePixelRatio !== undefined) ? window.devicePixelRatio : 1;

          // Create Style variable
          var style = '';

          // Bypass for the index size passed regardless of DPR
          if (bypass) {
            dpr = 1;
          }

          // If we've got a HighDPI device,
          if (dpr > 1.5 && dpr <= 3.5) {
            style = styleArray[index + 1];

            if (styleArray.length <= index + 1) {
              //console.log("handle index out of range!");
              style = styleArray[index];
            }
          }
          else {
            style = styleArray[index];
          }

          // Only swap the image if the required image is larger
          if (styleArray.indexOf(style) > styleArray.indexOf(imgStyle)) {
            var src = img.getAttribute('data-borealis-' + style);

            var loadImg = new Image();

            loadImg.onload = function() {
              loadImg.onload = null;

              var imgAttributes = img.attributes;
              var imgAttributeLength = imgAttributes.length;

              for (var i = 0; i < imgAttributeLength; i++) {
                if (imgAttributes[i].name != 'height' && imgAttributes[i].name != 'width' && imgAttributes[i].name != 'src' && imgAttributes[i].name != 'data-borealis-style' && imgAttributes[i].name != 'data-locked') {
                  loadImg.setAttribute(imgAttributes[i].name, imgAttributes[i].value);
                }
              }

              // Set the current style
              loadImg.setAttribute('data-borealis-style', style);

              // Remove the Placeholder class
              removeClass(loadImg, 'placeholder');

              // Add image to the DOM
              img.parentNode.replaceChild(loadImg, img);

              // Remove the Loading class, add the Loaded class
              removeClass(loadImg.parentNode, 'loading');
              addClass(loadImg.parentNode, 'loaded');

              // Run the whole thing over again
              borealisImagePlaceholder();
            };
            loadImg.src = src;

            //console.log('swap image augment');
          }
          else {
            //console.log('no need swap image augment');
            img.removeAttribute('data-locked');
          }
        }
      });

    }
  };

  Drupal.behaviors.pulsedotsvg = {
    attach: function (context, settings) {
      var mediabodytitle = document.querySelectorAll(".live-item-title .media-body"); //.inserthere

      function createPulsedotSVG(svgID) {
      var divsvg = document.createElement('div'); divsvg.setAttribute('class','pulsedotsvg jsadd');

      var svg = document.createElementNS('http://www.w3.org/2000/svg','svg');
      svg.setAttribute('xmlns','http://www.w3.org/2000/svg');
      svg.setAttribute('height','20px'); svg.setAttribute('width','20px'); svg.setAttribute('viewBox','0 0 14 14');

      var animate1 = document.createElementNS('http://www.w3.org/2000/svg','animate');
      animate1.setAttributeNS("http://www.w3.org/1999/xlink", "href", "#pulsedotback"+svgID);
      animate1.setAttribute('attributeName','r');
      animate1.setAttribute('from',3); animate1.setAttribute('to',6);
      animate1.setAttribute('dur', '1s'); animate1.setAttribute('begin', '0s');
      animate1.setAttribute('repeatCount', 'indefinite'); animate1.setAttribute('fill', 'freeze'); animate1.setAttribute('id', 'circ-anim');

      var animate2 = document.createElementNS('http://www.w3.org/2000/svg','animate');
      animate2.setAttributeNS("http://www.w3.org/1999/xlink", "href", "#pulsedotback"+svgID);
      animate2.setAttribute('attributeType','CSS');
      animate2.setAttribute('attributeName','opacity');
      animate2.setAttribute('from',1); animate2.setAttribute('to',0);
      animate2.setAttribute('dur', '1s'); animate2.setAttribute('begin', '0s');
      animate2.setAttribute('repeatCount', 'indefinite'); animate2.setAttribute('fill', 'freeze'); animate2.setAttribute('id', 'circ-anim');

      var circle1 = document.createElementNS('http://www.w3.org/2000/svg','circle');
      circle1.setAttribute('class','pulsedotback');
      circle1.setAttribute('id','pulsedotback'+svgID );
      circle1.setAttribute('cx','7.2'); circle1.setAttribute('cy','6.8');
      circle1.setAttribute('r','3'); circle1.setAttribute('stroke-width','1');

      var circle2 = document.createElementNS('http://www.w3.org/2000/svg','circle');
      circle2.setAttribute('class','pulsedotfront');
      circle2.setAttribute('cx','7.2'); circle2.setAttribute('cy','6.8');
      circle2.setAttribute('r','2.1');

      svg.appendChild(animate1); svg.appendChild(animate2); svg.appendChild(circle1); svg.appendChild(circle2);
      divsvg.appendChild(svg);
        return divsvg;
      }

      var mediamediabodytitleLen = mediabodytitle.length;
      for (var i = 0; i < mediamediabodytitleLen; i++) {
        mediabodytitle[i].appendChild( createPulsedotSVG('dotter'+i) );
      }
    }
  };

